import React from 'react';


function SearchBar({ onSearch }) {
    const handleInputChange = (e) => {
        onSearch(e.target.value);
    };
    
    return (
        <div>
            <input type="text" placeholder="Search" onInput={ handleInputChange }></input>
        </div>
    );
}

export default SearchBar;
